import getFullResponseFromAPI from "./1-promise";

getFullResponseFromAPI(true)
  .then((result) => {
    console.log(result);
  })
  .catch((error) => {
    console.error(error.message);
  });

getFullResponseFromAPI(false)
  .then((result) => {
    console.log(result);
  })
  .catch((error) => {
    console.error(error.message);
  });
